import React, { FunctionComponent } from 'react';
import './contactSection.scss';

const ContactSection : FunctionComponent = () => {
    
 return (
    <div className="row contact-row">
        <div className="col s12 contact-col">
            <div className="center-align">
                <span className="pink-bar">
                    <i className="material-icons">mail</i>&nbsp;<a className="link-contact" href="mailto:florencejacobs85@gmail.com">florencejacobs85@gmail.com</a>
                </span>
                <span className="pink-bar">
                    <i className="material-icons">phone_android</i>&nbsp;<a className="link-contact" href="tel:+32492865800">0492 865 800</a>
                </span>
                <span className="pink-bar pinkbar">
                <a href="https://www.linkedin.com/in/florence-jacobs/" target="_blank"><i className="fab fa-2x fa-linkedin"></i></a>&nbsp;<a href="https://github.com/FlorenceJacobs" target="_blank"><i className="fab fa-2x fa-github-square"></i></a>
                </span>
            </div>
        </div>
    </div>
  
 )
}
  
export default ContactSection;
